const Nav = () => (
  <div className="navbar">
    <div className="logo"></div>
    <div className="navitems">
      <Link href="/about">
        <a className="navlink">About</a>
      </Link>
      <Link href="/how">
        <a className="navlink">How</a>
      </Link>
      <Link href="/contact">
        <a className="navlink">Contact</a>
      </Link>
    </div>

    <style jsx>
      {`
        .navbar {
          display: flex;
          position: sticky;
          top: 0;
          background-color: pink;
          height: 15vh;
          width: 100%;
        }
        .logo {
        }
        .navitems {
          display: flex;
          justify-content: flex-end;
          align-items: center;
        }
        .navlink {
          display: block;
          border: 1px black solid;
          text-decoration: none;
          padding: 7px;
        }
      `}
    </style>
  </div>
);

export default Nav;
